import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { SleepService } from '../sleep.service';

@Component({
  selector: 'app-settings',
  templateUrl: './settings.page.html',
  styleUrls: ['./settings.page.scss'],
})
export class SettingsPage implements OnInit {

  constructor(private sleepService: SleepService, private router: Router) { }

  ngOnInit() {
  }

  switchTabs(route: string) {
    this.router.navigateByUrl('/tablinks/' + route);
  }

  clearData() {
    this.sleepService.clearData();
  }

}
<ion-header>
  <ion-toolbar>
    <ion-title>settings</ion-title>
  </ion-toolbar>
  <ion-buttons slot="start">
    <ion-button (click)="switchTabs('home')">
      <ion-icon name="arrow-back" color="secondary" size="large"></ion-icon>
    </ion-button>
  </ion-buttons>
</ion-header>

<ion-content>
  <ion-button (click)="clearData()" color="warning">Clear All Data</ion-button>
</ion-content>
